ToolBarButton.ClientEvent:
var entitys = view.get("#dataSetIeCategory").getData();
var selection = view.get("#dataGridIeCategory").get("selection");
if(selection.length==0){
    dorado.MessageBox.alert("请选择记录！");
}else if(selection.length>1){
    dorado.MessageBox.alert("只能选择一条记录查看修改！");
}else if (selection.length == 1) {
    view.get("#dataSetIeCategory").getData().setCurrent(selection[0]);
    view.get("#dialogIeCategory").show();
    view.get("#dataSetIeCategory").set("readOnly",false);
}

